  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Rachel
  Carson and Great Bay National Wildlife Refuges outlines Refuge accomplishments during
  the 1998 calendar year. The report begins with a summary of the year's  weather
  conditions. Land acquisition is covered. The report includes a planning section
  which focused on the master plan, management plan, public participation, compliance
  with environmental mandates, research and investigations, and other. Refuge administration
  is outlined; information about personnel, the volunteer program, funding, safety
  and technical assistance is covered. Habitat management is also covered; subjects
  include wetlands, forests, grasslands, fire management, and pest control. The wildlife
  section of the report discusses wildlife diversity, endangered and threatened species,
  waterfowl, marsh birds and waterbirds, shorebirds, raptors, other migratory birds,
  game mammals, marine mammals, animal control, and marking and bird banding. The
  public uses of the Refuge described in this report include outdoor classrooms, interpretive
  programs, hunting, fishing, wildlife observation, and law enforcement. The equipment
  and facilities section of the report provides information about rehabilitation,
  major maintenance, equipment utilization and replacement, communication systems,
  and computer systems.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
